import React, { useState } from 'react';
import AlbumTile from './AlbumTile';
import RecentlyPlayed from './RecentlyPlayed';
import './HomePage.css';

const Homepage = ({setSelectedSong}) => {


  return (
    <div classname='hp'>
      <div className='gr'>greeting</div>
      <div className='recplay'>recently played <RecentlyPlayed /></div>
      <div className='albums'>albums<AlbumTile setSelectedSong={setSelectedSong} /></div>
    </div>
  );
};

export default Homepage;
